import React from 'react';
import {
  Grid,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  TextField,
  Button,
  makeStyles,
  Checkbox,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
    width: '100%',
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
  button: {
    margin: theme.spacing(1),
  },
  searchField: {
    margin: theme.spacing(1),
    minWidth: 120,
    width: '100%',
  },
  table: {
    minWidth: 650,
  },
  filterContainer: {
    marginBottom: theme.spacing(3),
  },
  buttonContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    padding: theme.spacing(2),
  },
  csvTable: {
    width: '100%',
  },
}));

const LeftColumn = ({
  region, setRegion, platform, setPlatform, promotionType, setPromotionType,
  race, setRace, gender, setGender, furtherLocation, setFurtherLocation,
  avgViews, setAvgViews, filter, setFilter, handleResetFilters, data = [], selectedItems, handleSelectItem,
}) => {
  const classes = useStyles();

  return (
    <div>
      <Grid container spacing={3}>
        <Grid item xs={12} className={classes.filterContainer}>
          <FormControl variant="outlined" className={classes.formControl}>
            <InputLabel id="region-label">Region</InputLabel>
            <Select
              labelId="region-label"
              id="region-select"
              value={region}
              onChange={(e) => setRegion(e.target.value)}
              label="Region"
            >
              <MenuItem value=""><em>None</em></MenuItem>
              <MenuItem value="NA">North America</MenuItem>
              <MenuItem value="EU">Europe</MenuItem>
              <MenuItem value="AS">Asia</MenuItem>
            </Select>
          </FormControl>

          <FormControl variant="outlined" className={classes.formControl}>
            <InputLabel id="platform-label">Platform</InputLabel>
            <Select
              labelId="platform-label"
              id="platform-select"
              value={platform}
              onChange={(e) => setPlatform(e.target.value)}
              label="Platform"
            >
              <MenuItem value=""><em>None</em></MenuItem>
              <MenuItem value="TikTok">TikTok</MenuItem>
              <MenuItem value="Instagram">Instagram</MenuItem>
              <MenuItem value="YouTube">YouTube</MenuItem>
            </Select>
          </FormControl>

          <TextField
            id="search-field"
            label="Search"
            variant="outlined"
            className={classes.searchField}
            value={filter}
            onChange={(e) => setFilter(e.target.value)}
            fullWidth
          />

          <Button
            variant="contained"
            color="primary"
            onClick={handleResetFilters}
            className={classes.button}
            fullWidth
          >
            Reset Filters
          </Button>
        </Grid>

        <Grid item xs={12}>
          <Paper elevation={3}>
            <TableContainer>
              <Table className={classes.table} aria-label="simple table">
                <TableHead>
                  <TableRow>
                    <TableCell>Select</TableCell>
                    <TableCell>ID</TableCell>
                    <TableCell align="right">Name</TableCell>
                    <TableCell align="right">Platform</TableCell>
                    <TableCell align="right">Views</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {data.map((row) => (
                    <TableRow key={row.id}>
                      <TableCell padding="checkbox">
                        <Checkbox
                          checked={selectedItems.has(row.id)}
                          onChange={() => handleSelectItem(row.id)}
                          color="primary"
                        />
                      </TableCell>
                      <TableCell component="th" scope="row">{row.id}</TableCell>
                      <TableCell align="right">{row.name}</TableCell>
                      <TableCell align="right">{row.platform}</TableCell>
                      <TableCell align="right">{row.views}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
};

export default LeftColumn
